column4:
Wskaż prawdziwe stwierdzenia:
1) ropień płuca może być wynikiem centralnej martwicy nowotworu, przeważnie raka gruczołowego;
2) rak gruczołowy płuca rozwija się w jego obwodowych częściach;
3) ryzyko raka drobnokomórkowego, w odróżnieniu od raka płaskonabłonkowego płuc, jest słabo związane z paleniem tytoniu;
4) u pacjenta z nowotworem płuca jednostronne ściszenie szmerów oddechowych może być wynikiem nie tylko obecności płynu w jamie opłucnowej, ale także niedodmy z zatkania tożstronnego oskrzela lub porażenia nerwu przeponowego;
5) w diagnostyce „nieinfekcyjnej chrypki” i zespołu Hornera wystarczająca jest odpowiednia ocena laryngologiczna i neurologiczna;
6) rak płuca może przebiegać ze wzrostem stężenia antygenu rakowo-płodowego (CEA) w surowicy krwi. Prawidłowa odpowiedź to:

Wskaż prawdziwe stwierdzenia:
1) powiększenie węzła chłonnego nadobojczykowego lewego u pacjenta z rakiem żołądka, tzw. węzła Virchowa, nazywane jest także objawem Troisiera;
2) dysfagia nie występuje w przebiegu raka żołądka;
3) zakażenie Helicobacter pylori jest czynnikiem ryzyka raka gruczołowego żołądka typu jelitowego;
4) rozpoznanie wczesnego raka żołądka nie jest możliwe, gdy stwierdza się obecność przerzutów w regionalnych węzłach chłonnych;
5) rak wczesny żołądka może objawiać się nawracającymi krwawieniami;
6) leczenie endoskopowe jest zawsze wystarczającą metodą leczenia wczesnego raka żołądka. Prawidłowa odpowiedź to:

Wskaż prawdziwe stwierdzenia:
1) rak trzustki jest choroba tytoniozależną;
2) pierwszym objawem raka trzustki, u osoby po 50 r.ż. może być cukrzyca;
3) objaw Courvoisiera polega na wystąpieniu żółtaczki po ostrym bólu w okolicy prawego podżebrza, często towarzyszy mu objaw Chełmońskiego i objaw Murphy’ego;
4) śluzowe i surowicze nowotwory torbielowate trzustki występują częściej u mężczyzn;
5) wysokie stężenie CA-19-9 w surowicy ma wysoką czułość i swoistość w diagnostyce raka trzustki;
6) USG jamy brzusznej nie nadaje się do badań przesiewowych raka trzustki i monitorowania pooperacyjnego. Prawidłowa odpowiedź to:

Wskaż zdania prawdziwe:
1) nowotwór złośliwy nerki może przebiegać zarówno z niedokrwistością, jak i nadkrwistością;
2) rak jasnokomórkowy wcześnie daje przerzuty odległe, które mogą ulec regresji po usunięciu ogniska pierwotnego;
3) embolizacja tętnicy nerkowej nie ma znaczenia w terapii, u pacjenta z guzem nerki;
4) klasyczna triada objawów guza nerki (krwiomocz, guz wyczuwalny przez powłoki, ból w okolicy lędźwiowej) jest częsta, ale przeważnie wskazuje na znaczne zaawansowanie procesu nowotworowego;
5) nagłe wystąpienie żylaków sromu lub powrózka nasiennego nawet teoretycznie nie ma związku z patologią nerki lewej;
6) nabyta torbielowatość nerek uważana jest za stan przedrakowy. Prawidłowa odpowiedź to:

Wskaż prawdziwe stwierdzenia:
1) Hipertriglicerydemia >1000mg/dl jest uważana za rzadki czynnik ryzyka ostrego zapalenia trzustki;
2) objaw Cullena jest markerem ciężkiej postaci ostrego zapalenia trzustki;
3) w przebiegu ostrego zapalenia trzustki aktywność amylazy we krwi może utrzymywać się miesiącami, nawet po „wygaszeniu” choroby;
4) obecność zbiorników płynowych z martwicą >½ miąższu trzustki prognozują ciężki przebieg ostrego zapalenia trzustki wg CTSI;
5) przewlekłe zapalenie trzustki może być spowodowane zwężeniem i kamicą przewodu Wirsunga;
6) pacjenci z przewlekłym zapaleniem trzustki rozwijają objawy niedoboru wszystkich witamin rozpuszczalnych w tłuszczach. Prawidłowa odpowiedź to:

Wskaż objawy retencji CO2 w ostrej nakładającej się na przewlekłą niewydolności oddechowej typu II:
1) splątanie;
2) zimny obwód ciała;
3) trzepoczące drżenie rąk;
4) tachykardia zatokowa;
5) tętno skaczące. Prawidłowa odpowiedź to:

Wskaż prawdziwe stwierdzenia dotyczące zaporowych (obturacyjnych) chorób płuc u osób w podeszłym wieku:
1) astma nie pojawia się po raz pierwszy w wieku podeszłym, stąd objawy obturacji można przypisać przewlekłej obturacyjnej chorobie płuc;
2) pozytywne skutki rezygnacji z palenia tytoniu obserwuje się nawet do 80 roku życia;
3) zaawansowany wiek jest barierą uniemożliwiającą podejmowanie intensywnej terapii i wentylacji mechanicznej w ostrym epizodzie przewlekłej obturacyjnej choroby płuc;
4) ludzie starsi w mniejszym stopniu niż młodzi odczuwają zwężenie dróg oddechowych, zatem na podstawie ich opisu nie można wnioskować o nasileniu tego stanu;
5) w wieku podeszłym przyspieszenie czynności serca jest mniejsze w porównaniu do ludzi młodych przy tym samym stopniu zwężenia oskrzeli. Prawidłowa odpowiedź to:

Regularną terapię przeciwzapalną w astmie, najlepiej w postaci wziewnych kortkosteroidów należy podjąć u pacjenta, który:
1) nie stosuje agonistów receptorów β2-adrenergicznych;
2) doświadcza dolegliwości pojawiających się nie częściej niż jeden raz w tygodniu;
3) budzi się z powodu astmy co najmniej jeden raz w tygodniu;
4) podaje, że dolegliwości występują trzy razy w tygodniu lub częściej;
5) doświadczył zaostrzenia choroby w ciągu ostatnich 2 lat. Prawidłowa odpowiedź to:

U pacjenta wystąpiły objawy hipoglikemii. Stwierdzono niski poziom glukozy we krwi w pomiarze wykonanym w czasie trwania objawów, objawy ustąpiły po skorygowaniu hipoglikemii. Stężenie insuliny i peptydu C we krwi było podwyższone. Wskaż przyczyne:
1) niedoczynność przysadki;
2) guz insulinowy;
3) pierwotna niedoczynność przysadki;
4) pochodne sulfonylomocznika;
5) egzogenna insulina. Prawidłowa odpowiedź to:

Wskaż prawdziwe stwierdzenia dotyczące raka rdzeniastego tarczycy:
1) powstaje z komórek okołopęcherzykowych C tarczycy;
2) leczenie jodem radioaktywnym i supresja TSH za pomocą lewotyroksyny nie mają zastosowania w leczeniu tegu typu nowotworu;
3) odległe przerzuty w momencie rozpoznania występują często;
4) może wydzielać kalcytoninę, serotoninę, ACTH;
5) w następstwie hyperkalcytonemii mogą występować przewlekłe zaparcia. Prawidłowa odpowiedź to:

Poniżej wymieniono wybrane wskaźniki diagnostyczne lub objawy pozwalające na rozpoznanie oraz ocenę aktywności reumatoidalnego zapalenia stawów. Wskaż te, które nie wchodzą w skład podstawowej skali służącej ocenie aktywności tej choroby (Disease Activity Index; DAS):
1) subiektywna ocena nasilenia objawów przez pacjenta (w skali 0-100);
2) liczba leukocytów w badaniu morfologii krwi;
3) miano czynnika reumatoidalnego w klasie IgM;
4) wartość OB;
5) stężenie CRP;
6) stężenie fibrynogenu;
7) miano przeciwciał przeciwko cytrulinowanym peptydom; 8) liczba obrzękniętych stawów; 9) odsetek limfocytów w badaniu morfologii krwi. Prawidłowa odpowiedź to:

Poniżej wymieniono leki stosowane w terapii przewlekłej obturacyjnej choroby płuc. Wskaż te, które charakteryzują się krótkim czasem działania:
1) ipratropium;
2) tiopropium;
3) bromek glikopironium;
4) formoterol;
5) fenoterol;
6) salbutamol. Prawidłowa odpowiedź to:

Które leki nie są lekami pierwszego rzutu w leczeniu niewydolności serca z obniżoną frakcją wyrzutową wg współczesnych wytycznych europejskich?
1) długodziałające nitraty;
2) dihydropirydynowe blokery kanału wapniowego;
3) dapagliflozyna;
4) semaglutyd;
5) digoksyna;
6) ramipryl;
7) torasemid; 8) eplerenon. Prawidłowa odpowiedź to:

W rozpoznaniu atopowego zapalenia skóry kryteria większe (podstawowe) to:
1) świąd;
2) przewlekły i nawrotowy przebieg choroby;
3) charakterystyczna lokalizacja i charakter zmian skórnych;
4) podwyższone stężenie IgE w surowicy;
5) eozynofilia we krwi obowodowej. Prawidłowa odpowiedź to:

Wskaż prawdziwe stwierdzenie dotyczące ran postrzałowych:
1) charakteryzują się powstawaniem przestrzeni w wyniku kawitacji;
2) prędkość początkowa pocisku, w przypadku broni palnej jest najwyższa;
3) charakteryzują się mniejszym potencjałem urazu z dużej odległości;
4) charakteryzują się większym potencjałem urazu z dużej odległości;
5) liczba ran postrzałowych śmiertelnych jest wyższa, niż ran nieprowadzących do śmierci. 
Prawidłowa odpowiedź to:

Wskaż prawdziwe stwierdzenia dotyczące urazów powstałych upadkiem z wysokości:
1) rozległość urazu zależy od masy ciała osoby upadającej oraz charakteru powierzchni, na którą spadła;
2) wielkość urazu zależy tylko od ułożenia ciała w chwili upadku;
3) miękka, plastyczna powierzchnia potrafi zmniejszyć siłę wyhamowania 10-20 razy;
4) odzież nie wpływa na rozległość urazu;
5) upadek z wysokości ponad 20 metrów, na twardą powierzchnie obarczony jest niską śmiertelnością. Prawidłowa odpowiedź to:

Do objawów klinicznych odmy prężnej zalicza się:
1) zaburzenia krążeniowo-płucne (bradykardia, nadciśnienie);
2) poszerzone żyły szyjne;
3) asymetria ruchomości klatki piersiowej;
4) nadmiernie jawny odgłos opukowy po stronie odmy;
5) nadmiernie wzmożone szmery oddechowe po stronie odmy. Prawidłowa odpowiedź to:

W badaniu per rectum, u chorego po urazie oceniane jest:
1) napięcie zwieraczy odbytu;
2) spoistość prostaty;
3) obecność krwi w odbytnicy;
4) złamania kości miednicy;
5) uszkodzenia okolicy krocza. Prawidłowa odpowiedź to:

Wskaż prawdziwe stwierdzenia dotyczące objawów klinicznych, związanych z przepuklinami u pacjentów dorosłych:
1) przepukliny pachwinowe przebiegają najczęściej bezobjawowo, a przyczyną zgłaszania się do lekarza są objawy guza w okolicy pachwinowej, a nie dolegliwości bólowe;
2) obustronne przepukliny pachwinowe nie należą do rzadkości, ale najczęściej maja rożne rozmiary;
3) przepuklina mosznowa jest jednym z typów przepukliny pachwinowej prostej;
4) przepuklina udowa uwypukla się poniżej i bocznie od guzka łonowego;
5) podczas kaszlu wyczuwalny jest ucisk przepukliny na opuszkę badającego palca. Prawidłowa odpowiedź to:

Wskaż prawdziwe stwierdzenia dotyczące leczenia przepuklin pachwinowych
1) większość zabiegów wykonywana jest w trybie jednodniowym;
2) laparoskopowe zaopatrzenie przepuklin pachwinowych związane jest z większym nasileniem dolegliwości bólowych bezpośrednio po zabiegu;
3) stosowanie dostępu laparoskopowego w leczeniu przepuklin wymaga znieczulenia ogólnego;
4) technika laparoskopowa zaopatrywania przepuklin jest szczególnie korzystna u chorych z przepuklinami nawrotowymi lub obustronnymi;
5) w przypadku tzw. przepukliny sportowców wymagane jest leczenie operacyjne w trybie nagłym. Prawidłowa odpowiedź to:

W leczeniu szczeliny odbytu stosuje się następujące postępowanie:
1) leczenie farmakologiczne;
2) plastyka z wykorzystaniem płata przesuniętego;
3) krem z diltazemem;
4) wewnetrzna sfinkterotomia;
5) chirurgiczne wycięcie odbytu. Prawidłowa odpowiedź to:

Wskaż prawdziwe stwierdzenia dotyczące leczenia chorych z chorobą wrzodową żołądka lub dwunastnicy:
1) infekcja Helicobacter Pylori odgrywa istotną role w powstawaniu wrzodów dwunastnicy, a leczenie eradykacyjne jest podstawą leczenia takich chorych;
2) zespół poposiłkowy, u chorych po resekcji żołądka występuje 15-30 min po jedzeniu i objawia się biegunką, wymiotami, tachykardią, poceniem się i kołataniem serca;
3) niedokrwistość często występuje u chorych po całkowitej resekcji żołądka;
4) leczenie operacyjne choroby wrzodowej zwiększa ryzyko rozwoju raka gruczołowego żołądka;
5) resekcja żołądka nie prowadzi do zaburzeń wchłaniania witaminy D i wapnia. Prawidłowa odpowiedź to:

Wskaż prawdziwe stwierdzenia dotyczące raka żołądka:
1) najczęstszym nowotworem złośliwym żołądka u dorosłych jest gruczolakorak;
2) statystycznie w ostatnich latach doszło do znacznego podwyższenia zachorowalności na raka żołądka;
3) rak żołądka częściej występuje u kobiet niż u mężczyzn;
4) eradykacja Helicobacter pylori zmniejsza ryzyko zachorowania na raka żołądka;
5) przewlekłe zanikowe zapalenie błony śluzowej żołądka jest czynnikiem ryzyka rozwoju raka żołądka. Prawidłowa odpowiedź to:

Wskaż prawdziwe stwierdzenia dotyczące chorych z kamicą pęcherzyka żółciowego:
1) ostre zapalenie pęcherzyka żółciowego charakteryzuje się większymi dolegliwościami, o dłuższym czasie trwania niż kolka żółciowa;
2) objawy wodniaka pęcherzyka są takie same jak przewlekłego zapalenia pęcherzyka żółciowego;
3) ostre bezkamicze zapalenie pęcherzyka żółciowego występuje częściej niż zapalenie na tle kamicy;
4) wieloletnia kamica pęcherzykowa nie wpływa na zapadalność na raka pęcherzyka żółciowego;
5) „pęcherzyk truskawkowy” jest jedną z postaci kamicy pęcherzyka z obecnością kamieni cholesterolowych. Prawidłowa odpowiedź to:

Jakie problemy położnicze mogą stwarzać mięśniaki macicy?
1) poronienie;
2) poród przedwczesny;
3) nieprawidłowe położenie płodu;
4) obfite, przedłużające się krwawienia miesięczne;
5) krwotok poporodowy. Prawidłowa odpowiedź to:

Wskaż objawy zespołu Meigsa:
1) ból podbrzusza;
2) przewlekłe zaparcia;
3) częstomocz;
4) obecność płynu w jamie otrzewnej;
5) obecność płynu w jamie opłucnej. Prawidłowa odpowiedź to:

Wskaż metody, dzięki którym można w sposób pewny rozpoznać raka endometrium?
1) ocena endometrium w przezpochwowym badaniu USG;
2) biopsja endometrium pod kontrolą wzroku w histeroskopii;
3) biopsja aspiracyjną endometrium;
4) biopsja rysowa endometrium;
5) wyłyżeczkowanie jamy macicy. Prawidłowa odpowiedź to:

Czynniki ryzyka przedwczesnego oddzielenia łożyska to:
1) krótka pępowina;
2) niedociśnienie tętnicze;
3) małowodzie;
4) nikotynizm. Prawidłowa odpowiedź to:

Spośród poniżej wymienianych badań wskaż te, które znalazły zastosowanie w skryningu populacyjnym raka jajnika.
1) test OVERA;
2) test ROMA;
3) USG u pacjentek nosicielek mutacji w genach BRCA1/2 w połączeniu z oceną CA125;
4) test ROCA;
5) CA 125;
6) USG ginekologiczne wykonywane co 12 miesięcy. Prawidłowa odpowiedź to:

Wskaż czynniki biologiczne i prognostyczne charakterystyczne dla typu II raka jajnika:
1) mutacje tp53;
2) wolny wzrost;
3) mała wrażliwość na chemioterapię;
4) złe rokowanie;
5) histopatologiczny typ; rak surowiczy G2;
6) duża genetyczna stabilność. Prawidłowa odpowiedź to:

Wybierz cechy określające ziarniszczaka:
1) guz produkuje najczęściej androstendion i inhibinę;
2) u części przypadków 30-50% stwierdza się zmiany przednowotworowe w zakresie szyjki macicy (CIN);
3) najczęściej występuje przed pokwitaniem;
4) charakteryzuje się występowaniem późnych nawrotów;
5) zmiany w stopniu FIGO IA można leczyć jednostronnym usunięciem przydatków z biopsją zdrowego przydatka oraz wykonaniem pełnego stagingu chirurgicznego;
6) ziarniszczak wywodzi się z guzów ze sznurów płciowych i podścieliska jajnika. Prawidłowa odpowiedź to:

Wskaż cele leczenia zespołu policystycznych jajników (PCOS):
1) zmniejszenie nasilenia hiperandrogenizacji;
2) leczenie niepłodności;
3) indukcja owulacji;
4) poprawa parametrów metabolicznych;
5) zmniejszenie ryzyka rozwoju cukrzycy;
6) zmniejszenie ryzyka rozwoju raka endometrium. Prawidłowa odpowiedź to:

Do głównych zaburzeń hormonalnych u kobiet z zespołem policystycznych jajników PCOS zalicza się:
1) zwiększone stężenia LH;
2) zwiększone stężenie FSH;
3) insulinooporność;
4) hiperinsulinemię;
5) hiperestrogenizm;
6) hiperandrogenemię. Prawidłowa odpowiedź to:

Wskaż czynniki ryzyka rozwoju zapalenia narządów miednicy mniejszej (PID, Pelvic inflammatory disease):
1) ryzykowne zachowania seksualne;
2) stosowanie barierowych środków antykoncepcyjnych;
3) wyłyżeczkowanie kanału szyjki macicy i jamy macicy;
4) elektroresekcję endometrium;
5) założenie wewnątrzmacicznej wkładki antykoncepcyjnej. Prawidłowa odpowiedź to:

U 35-letniej pacjentki, od 8 miesięcy utrzymują się niespecyficzne dolegliwości bólowe podbrzusza. Chora zgłasza, że dolegliwości utrudniają jej normalną aktywność zawodową. W wykonanym przez ginekologa badaniu zestawionym i skriningowym badaniu przezpochwowym ultrasonograficznym nie stwierdzono zmian patologicznych. Wskaż przyczyny zespołu bólowego miednicy mniejszej u chorej:
1) endometrioza głęboka więzadeł krzyżowo-kolcowych;
2) śródmiąższowe zapalenie pęcherza moczowego;
3) celiakia;
4) neuralgia nerwu trójdzielnego;
5) neuralgia gałęzi splotu krzyżowego. Prawidłowa odpowiedź to:

Wskaż prawdziwe stwierdzenia dotyczące onkogennych typów wirusa HPV:
1) mogą być przyczyną rozwoju raka szyjki macicy;
2) mogą być przyczyną rozwoju nowotworów złośliwych jamy ustnej i nosogardła;
3) wbudowanie DNA wirusa HPV do komórki gospodarza powoduje zahamowanie ekspresji dwóch białek wirusowych E6 i E7 z wtórną ekspresją białek E1 i E2, co jest uważane za początek procesu karcynogenezy;
4) po zakażeniu wirusem onkogennym HPV u nieleczonych kobiet prawie zawsze dochodzi do rozwoju raka szyjki macicy;
5) supresja białka TP53 w komórce gospodarza sprzyja nieograniczonej proliferacji zakażonej komórki. Prawidłowa odpowiedź to:

Wskaż działania profilaktyczne w onkologii ginekologicznej:
1) szczepienia;
2) badania cytologiczne;
3) leczenie zespołu policystycznych jajników;
4) stosowanie barierowych środków antykoncepcyjnych;
5) stosowanie niezrównoważonej estrogenowej terapii hormonalnej wieku menopauzalnego. Prawidłowa odpowiedź to:

Leczenie raka inwazyjnego szyjki macicy zależy od stopnia zaawansowania nowotworu. W leczeniu raka szyjki macicy zastosowanie znajdują:
1) LLETZ (Large Loop Excision of Transformation Zone);
2) histerektomia z limfadenektomią;
3) radioterapia;
4) chemioterapia;
5) hormonoterapia. Prawidłowa odpowiedź to:

Badania przesiewowe należy prowadzić, jeśli znany jest prosty, nieinwazyjny lub małoinwazyjny test pozwalający wykryć chorobę nowotworową lub stan przednowotworowy. Wskaż prawdziwe stwierdzenia:
1) efektem badań przesiewowych powinno być obniżenie śmiertelności związanej z nowotworem;
2) rak jajnika jest nowotworem, dla którego dostępne są wysokoczułe badania przesiewowe;
3) badanie cytologii szyjki macicy to uznane badanie przesiewowe w kierunku raka szyjki macicy;
4) histeroskopia diagnostyczna to uznane badanie przesiewowe w kierunku raka trzonu macicy;
5) detekcja DNA wysokoonkogennych wirusów HPV z kanału i tarczy szyjki macicy może zwiększyć czułość i swoistość badań przesiewowych w kierunku raka szyjki macicy. Prawidłowa odpowiedź to:

Stężenie glikoproteiny Ca-125 może być podwyższone u pacjentki z:
1) rakiem jajnika;
2) endometriozą głębokonaciekającą (DIE);
3) rakiem endometrium;
4) PID (zapalenie miednicy mniejszej);
5) wyłącznie u pacjentki z rakiem jajnika w stadium >IA wg FIGO. Prawidłowa odpowiedź to:

Stężenie glikoproteiny HE-4 (human epidydymis protein
4) może być podwyższone u pacjentki z:
1) rakiem jajnika;
2) rakiem płuca;
3) niewydolnością nerek;
4) PID (zapalenie miednicy mniejszej);
5) wyłącznie u pacjentki z rakiem jajnika w stadium >IA wg FIGO. Prawidłowa odpowiedź to:

Wskaż prawdziwe stwierdzenia dotyczące Raka jajnika występującego u pacjentek nosicielek mutacji BRCA1 i/lub BRCA2:
1) występuje średnio o 10 lat wcześniej niż rak jajnika niezwiązany z mutacjami;
2) występuje średnio o 10 lat później niż rak jajnika niezwiązany z mutacjami;
3) cechuje się wyższą wrażliwością na leczenie systemowe niż rak jajnika niezwiązany z mutacjami;
4) cechuje się niższą wrażliwością na leczenie systemowe niż rak jajnika niezwiązany z mutacjami;
5) najczęściej jest rakiem o wysokim stopniu złośliwości histologicznej G3. Prawidłowa odpowiedź to:

Wg protokołu ERAS (enhanced recovery after surgery) właściwym postępowaniem okołooperacyjnym jest:
1) szybki powrót do żywienia doustnego najlepiej w pierwszej dobie po operacji;
2) jak najdłuższe utrzymanie cewnika Foleya w pęcherzu moczowym celem ścisłego monitorowania diurezy pooperacyjnej (36-100 godzin);
3) rutynowe stosowanie zgłębnika nosowo-żołądkowego;
4) stosowanie małoinwazyjnych technik operacyjnych;
5) zakaz stosowania leków przeciwwymiotnych w okresie pooperacyjnym. Prawidłowa odpowiedź to:

Do wskazań do histerektomii zalicza się:
1) niepoddający się leczeniu krwotok położniczy;
2) rak trzonu macicy FIGO 1B;
3) rak szyjki macicy FIGO III;
4) rak jajnika;
5) mięśniaki macicy. Prawidłowa odpowiedź to:

Steroidoterapia prenatalna jest najistotniejszym elementem postępowania wobec ciężarnych z porodem przedwczesnym. Wskaż prawdziwe stwierdzenia:
1) betametazon stosujemy między 24-36 tygodniem ciąży;
2) betametazon stosujemy między 24-34 tygodniem ciąży;
3) w czasie steroidoterapii nie wolno stosować antagonistów receptorów oksytocynowych;
4) pełen cykl steroidoterapii trwa 24 godziny;
5) pełen cykl steroidoterapii trwa 48 godzin. Prawidłowa odpowiedź to:

Wskaż przyczyny wielowodzia:
1) wady dysraficzne płodu;
2) wysoka niedrożność przewodu pokarmowego u płodu;
3) zespół przetoczenia krwi między płodami TTTS;
4) cukrzyca ciężarnych;
5) agenezja nerek płodu. Prawidłowa odpowiedź to:

Do leków przeciwnadciśnieniowych stosowanych w ciąży zalicza się:
1) labetalol;
2) metyldopa;
3) dihydralazyna;
4) sartany;
5) inhibitory angiotensyny. Prawidłowa odpowiedź to:

Wskaż prawdziwe stwierdzenia dotyczące histeroskopowej resekcji przegrody macicy:
1) wskazaniem do zabiegu są powtarzające się utraty ciąż;
2) pacjentka nie może zajść w ciążę przed upływem 12 miesięcy od zabiegu;
3) do diagnostyki przegrody macicy konieczne jest wykonanie tomografii komputerowej;
4) jednym z możliwych powikłań zabiegu jest perforacja macicy;
5) najczęściej operację wykonuje się w asyście laparoskopowej. Prawidłowa odpowiedź to:

Wskaż czynniki ryzyka zaburzeń statyki narządów miednicy:
1) rodność;
2) choroby genetyczne tkanki łącznej;
3) wycięcie macicy;
4) przewlekły kaszel w przebiegu POChP;
5) rodzaj wykonywanej pracy. Prawidłowa odpowiedź to:

Wskaż prawdziwe stwierdzenie dotyczące kiły II okresu:
1) jest skutkiem krwiopochodnego rozsiewu T. pallidum;
2) zwykle występuje w ciągu 6-9 tygodni od wystąpienia kiły I okresu;
3) jest kiłą późną;
4) objawia się jako charakterystyczna osutka skóry i błon śluzowych występującą u 25% chorych;
5) towarzyszyć jej może bolesne powiększenie węzłów chłonnych. Prawidłowa odpowiedź to:

Wskaż prawdziwe stwierdzenia dotyczące zapalenie narządów miednicy mniejszej:
1) bakteryjne zakażenie krwiopochodne jest najczęstszą przyczyną zapalenia narządów miednicy mniejszej;
2) choroby przenoszone drogą płciową odpowiadają za 10-25% zapaleń narządów miednicy mniejszej;
3) najczęściej zgłaszanym objawem zapalenia narządów miednicy mniejszej jest ból podbrzusza, gorączka, upławy i krwawienia z dróg rodnych;
4) dyspareunia głęboka nie jest objawem zapalenia narządów miednicy mniejszej;
5) jednorazowe przebycie zapalenia narządów miednicy mniejszej nie zwiększa ryzyka leczenia niepłodności. Prawidłowa odpowiedź to:

Wskaż czynniki ryzyka wystąpienia polipów w jamie macicy:
1) wiek pacjentki;
2) endometrioza;
3) wysokie BMI;
4) cukrzyca;
5) sterydoterapia. Prawidłowa odpowiedź to:

Wskaż prawdziwe stwierdzenie dotyczące torbieli ciałka żółtego:
1) osiągają zwykle średnicę 4-6 cm;
2) ich przyczyną są zaburzenia hormonalne;
3) za niska produkcja progesteronu może prowadzić do powstania torbieli ciałka żółtego;
4) są zaliczanie do torbieli czynnościowych jajnika;
5) do czynników ryzyka powstania torbieli ciałka żółtego należą palenie tytoniu, antykoncepcja i terapia tamoksyfenem. Prawidłowa odpowiedź to:

W trakcie badania fizykalnego pacjentek z nietrzymaniem moczu obowiązkowo należy wykonać:
1) badanie ogólne moczu;
2) badanie ginekologiczno-urologiczne;
3) próbę kaszlową;
4) posiew moczu;
5) ocenę zalegającego moczu. Prawidłowa odpowiedź to:

Wskaż prawdziwe stwierdzenie dotyczące niepowściągliwych wymiotów ciężarnych:
1) występują z częstotliwością ok. 25%;
2) mogą prowadzić do utraty masy ciała ciężarnej powyżej 5%;
3) mogą powodować kwasicę ketonową;
4) nie wymagają diagnostyki laboratoryjnej;
5) ciąża mnoga oraz zaśniad groniasty mogą nasilać dolegliwości. Prawidłowa odpowiedź to:

Wskaż prawdziwe stwierdzenia dotyczące poronień nawracających:
1) są to następujące po sobie co najmniej 2 poronienia;
2) do przyczyn zaliczamy między innymi czynniki genetyczne, immunologiczne, anatomiczne, zakrzepowe oraz zakaźne;
3) we wczesnej ciąży poronienia są zwykle związane z defektami chromosomalnymi;
4) diagnostyka poronień nawracających powinna składać się z badania kariotypu pacjentki i jej partnera;
5) diagnostyka w kierunku cukrzycy i chorób tarczycy pełni marginalną rolę w diagnostyce poronień nawykowych. Prawidłowa odpowiedź to:

Wskaż prawdziwe stwierdzenia dotyczące przedwczesnego oddzielenia się łożyska:
1) czynniki ryzyka to między innymi: nadciśnienie tętnicze, krótka pępowina, nieprawidłowa budowa macicy oraz łożysko przodujące;
2) krwotok z dróg rodnych musi być stwierdzony w przebiegu przedwczesnego oddzielenia łożyska;
3) ryzyko wystąpienia ponownego przedwczesnego oddzielenia łożyska w następnej ciąży wzrasta;
4) powikłaniami tej jednostki są: wstrząs krwotoczny, DIC, udar macicznołożyskowy, zator płynem owodniowym oraz zgon rodzącej i płodu;
5) urazy komunikacyjne mogą prowadzić do przedwczesnego oddzielenia łożyska. Prawidłowa odpowiedź to:

Wskaż prawdziwe stwierdzenia dotyczące diagnostyki cukrzycy ciążowej:
1) glikemia na czczo wyższa bądź równa 92 mg/dl wskazuje na cukrzycę ciążową;
2) po uzyskaniu wyniku glikemii na czczo poniżej 92 mg/dl, do 10. tygodnia ciąży, należy odstąpić od dalszej diagnostyki;
3) w przypadku glikemii na czczo powyżej 125 mg/dl należy pilnie wykonać test OGTT;
4) test OGTT u ciężarnych należy wykonać z użyciem 60 g glukozy;
5) podczas testu OGTT u ciężarnych należy oznaczyć wyłącznie glikemię na czczo i po 2h po podaniu glukozy. Prawidłowa odpowiedź to:

Wskaż prawdziwe stwierdzenia dotyczące zatorowości płucnej w ciąży:
1) w krajach zachodnich jest najczęstszą przyczyną zgonów kobiet w ciąży;
2) objawy kliniczne to m. in.: duszność, ból opłucnowy i krwioplucie;
3) żylna choroba zakrzepowo-zatorowa (VTE) może dotyczyć nawet 1 na 1000 ciężarnych;
4) prekoncepcyjnymi czynnikami ryzyka są między innymi: przebyty epizod VTE, otyłość i wiek pacjentki powyżej 35 r.ż.;
5) czynnikiem ryzyka jest unieruchomienie przed ponad 3 dni oraz podróże trwające powyżej 4 godzin. Prawidłowa odpowiedź to:

Wskaż prawdziwe stwierdzenie dotyczące krwotoku poporodowego:
1) najczęstszymi przyczynami są: atonia macicy, pozostałości popłodu w jamie macicy oraz urazy kanału rodnego;
2) do przedporodowych czynników predysponujących zalicza się między innymi: wielorództwo, wiek ponad 35 lat oraz otyłość;
3) śródporodowymi czynnikami ryzyka są: zakażenie wewnątrzmaciczne, indukcja i stymulacja porodu, przedłużony czas trwania porodu oraz sposób ukończenia ciąży;
4) krwotoki poporodowe podzielone są na wczesne w ciągu 24h po porodzie oraz późne od 25 godzin do 6 tygodni po porodzie;
5) objawy kliniczne w postaci obniżonego ciśnienia tętniczego lub tachykardii mogą się pojawić u matki późno, gdy utrata krwi wynosi 1000-1500 ml. Prawidłowa odpowiedź to:

Wskaż prawdziwe stwierdzenia dotyczące raka szyjki macicy:
1) jest najczęściej rakiem gruczołowym;
2) nie występuje w ciąży;
3) w nisko zaawansowanym raku szyjki macicy najczęściej nie obserwuje się żadnych objawów klinicznych;
4) jednym z objawów raka szyjki macicy są krwawienia międzymiesiączkowe;
5) rozpoznanie ustala się na podstawie wyniku biopsji szyjki macicy. Prawidłowa odpowiedź to:

Wskaż prawdziwe stwierdzenie dotyczące potworniaka niedojrzałego:
1) występuje zwykle jednostronnie;
2) praktycznie zawsze występuje po menopauzie;
3) może być oporny na chemioterapię dlatego zalecana jest maksymalna cytoredukcja;
4) jest łagodnym guzem z niskim ryzykiem przerzutów;
5) stanowi 10-20% guzów złośliwych jajników rozpoznawalnych przed 20 rokiem życia. Prawidłowa odpowiedź to:

Wskaż prawdziwe stwierdzenie dotyczące raka kosmówki:
1) może rozwinąć się po zaśniadzie całkowitym i częściowym;
2) nie może rozwinąć się po ciąży zakończonej porodem;
3) rozpoznanie stawia się na podstawie stężenia hCG w surowicy;
4) leczenie raka kosmówki jest leczeniem chirurgicznym;
5) przerzuty najczęściej występują w płucach. Prawidłowa odpowiedź to:

Wskaż prawdziwe stwierdzenia dotyczące raków jajnika typu II:
1) rozwijają się bardzo szybko;
2) w momencie rozpoznania są często rozsiane w jamie brzusznej;
3) charakteryzują się małą wrażliwością na chemioterapię;
4) rokowanie jest złe (90% chorych umiera);
5) to między innymi rak jasnokomórkowy, śluzowy i rak Brennera. Prawidłowa odpowiedź to:

Wskaż prawdziwe stwierdzenia dotyczące markerów nowotworów złośliwych:
1) oznaczenie stężenia CA 125 w surowicy krwi jest zawsze podwyższone w przypadku raka jajnika;
2) ocena stężenia CA 125 podczas chemioterapii raka jajnika nie powinna być proponowana;
3) podwyższone stężenie białka HE 4 obserwuje się w nowotworach złośliwych jajnika, raku płuc i trzustki;
4) rak pęcherzyka żółtkowego wydziela alfa-fetoproteinę, która jest czułym markerem używanym do monitorowania leczenia;
5) podwyższone stężenie CA 125 obserwowane jest między innymi w endometriozie, mięśniakach macicy, marskości wątroby oraz w trakcie miesiączki. Prawidłowa odpowiedź to:

Wskaż prawdziwe stwierdzenia dotyczące zaśniadu groniastego:
1) u ciężarnych z zaśniadem groniastym często występują nadmierne wymioty;
2) u ciężarnych z zaśniadem groniastym występują objawy niedoczynności tarczycy;
3) rozpoznanie zaśniadu groniastego całkowitego jest możliwe dzięki charakterystycznemu obrazowi w badaniu ultrasonograficznym;
4) u około 20% chorych po opróżnieniu macicy może rozwinąć się przetrwała choroba trofoblastyczna;
5) nie należy podejmować zabiegów chirurgicznych w przypadku zaśniadu groniastego całkowitego, należy zaczekać na samoistne opróżnienie jamy macicy. Prawidłowa odpowiedź to:

Wskaż prawdziwe stwierdzenia dotyczące raka jajnika:
1) podstawowym schematem chemioterapii są pochodne platyny i paklitaksel;
2) jednymi z objawów są objawów raka jajnika są wzdęcia i uczucie pełności;
3) większość raków jajnika wykrywana jest w niskim stadium zaawansowania;
4) rak jajnika nie dotyczy kobiet przed 40 rokiem życia;
5) parcia naglące nie są objawem raka jajnika. Prawidłowa odpowiedź to:

Uszkodzenie nerwu krtaniowego wstecznego, jako jedna z przyczyn chrypki, może powstać na skutek:
