1) bakteryjne zapalenie gardła lub migdałków;
2) bakteryjne zapalenie zatok;
3) niepowikłane zapalenie pęcherza moczowego u kobiet;
4) ostre odmiedniczkowe zapalenie nerek;
5) biegunka podróżnych. Prawidłowa odpowiedź to:

Natychmiastowe zastosowanie antybiotyku w ostrym zapaleniu ucha środkowego jest zalecane u:
1) dzieci poniżej 6. miesiąca życia;
2) dzieci powyżej 2. roku życia, z obustronnym zapaleniem ucha środkowego;
3) dzieci z wysoką gorączką (>39°C), znacznie nasilonymi dolegliwościami bólowymi i wymiotami;
4) chorych z wyciekiem ropnym z ucha;
5) chorych z ograniczonym dostępem do opieki medycznej. Prawidłowa odpowiedź to:

Prawidłowy osad moczu nie powinien zawierać kryształków:
1) cystyny;
2) fosforanu amonowo-magnezowego;
3) kwasu moczowego;
4) szczawianów wapnia;
5) fosforanów wapnia. Prawidłowa odpowiedź to:

Wskaż fałszywe stwierdzenia dotyczące chorób nowotworowych:
1) spożycie 10-20 g dziennie alkoholu jest uznanym czynnikiem ryzyka wystąpienia raka wątrobowokomórkowego i dróg żółciowych;
2) do profilaktyki wtórnej raka jelita grubego zalicza się wykonywanie rektosigmoidoskopii co 10 lat;
3) bezobjawowa hiperkalcemia pogarsza rokowanie u chorego na nowotwór;
4) sensowność wykonywania badań obrazowych lub badań krwi w profilaktyce chorób nowotworowych u chorych bezobjawowych jest niewielka;
5) pojawienie się gorączki u chorych leczących się cytostatykami wymaga wykonania pilnej morfologii krwi. Prawidłowa odpowiedź to:

Wskaż prawdziwe stwierdzenia dotyczące choroby rozrostowej krwi:
1) w przypadku przewlekłej białaczki szpikowej w 50% stwierdza się obecność chromosomu Philadelfia;
2) guz śródpiersia nigdy nie powoduje zespołu żyły głównej górnej;
3) mediana rozpoznania ostrej białaczki szpikowej to 57. rok życia;
4) ambulatoryjne wykonywanie morfologii krwi i USG jamy brzusznej u dziecka z podejrzeniem ostrej białaczki szpikowej może opóźnić rozpoznanie;
5) konieczne do rozpoznania ostrej białaczki szpikowej jest stwierdzenie minimum 20% komórek blastycznych w rozmazie krwi i/lub szpiku. Prawidłowa odpowiedź to:

Wskaż objawy, które mogą towarzyszyć rakowi drobnokomórkowemu płuc:
1) ból barku w guzie Pancoasta;
2) zespół Lamberta-Eatona;
3) zespół Cushinga;
4) ubytek masy ciała;
5) rogowacenie ciemne. Prawidłowa odpowiedź to:

Wskaż prawdziwe stwierdzenia dotyczące raka drobnokomórkowego płuc:
1) podwyższenie stężenia dehydrogenazy mleczanowej jest złym wskaźnikiem rokowniczym;
2) pojawienie się wymiotów kilka dni po zastosowaniu leczenia jest charakterystyczne dla chemioterapeutyków stosowanych w trakcie leczenia raka drobnokomórkowego płuc;
3) leczenie operacyjne jest preferowaną metodą leczenia;
4) zdjęcie RTG to najskuteczniejsza metoda obrazowania odpowiedzi na chemioterapię;
5) guz w przypadku raka drobnokomórkowego płuc może być czynny neuroendokrynnie. Prawidłowa odpowiedź to:

Wskaż prawdziwe stwierdzenia dotyczące gruczolakowłókniaka piersi (fibroadenoma):
1) objawem odróżniającym fibroadenoma od ropnia jest, np. objaw chełbotania typowy dla zmiany ropnej;
2) guz piersi powinien być oceniony według 5-stopiowej skali Birads;
3) ujemny wynik BAC wyklucza obecność raka;
4) późna menarche zwiększa ryzyko jego wystąpienia;
5) klinicznie jest trudny do odróżnienia od guza liściastego piersi. Prawidłowa odpowiedź to:

Wskaż prawdziwe stwierdzenia dotyczące profilaktyki raka szyjki macicy:
1) szczepionka Cervarix jest refundowana po ukończeniu 9. roku życia;
2) przyjęcie schematu 1-dawkowego daje porównywalną skuteczność do schematu 2dawkowego;
3) dzieci po ukończeniu 15. roku życia powinny przyjąć schemat 3-dawkowy;
4) u dzieci między 9. a 14. rokiem życia, jeżeli między 1. a 2. dawką odstęp wynosił mniej niż 5 miesięcy zawsze należy podać trzecią dawkę;
5) kobiet w ciąży nie należy szczepić szczepionką Cervarix. Prawidłowa odpowiedź to:

Wskaż prawdziwe stwierdzenia dotyczące bólu i jego możliwej przyczyny:
1) ból w nocy – ból nowotworowy;
2) ból zmniejszający się w pozycji siedzącej i stojącej, zwiększający w leżącej, z uczuciem ciasnoty w brzuchu – kompresyjne złamanie trzonów kręgowych;
3) ból zwiększający się w pozycji siedzącej – stenoza kanału kręgowego;
4) ból pojawiający się przy kaszlu – przepuklina jądra miażdżystego;
5) ból zmniejszający się w pozycji siedzącej – stenoza kanału kręgowego. Prawidłowa odpowiedź to:

Wskaż prawdziwe stwierdzenia dotyczące parazytozy wywołanej owsikiem ludzkim:
1) w jelicie grubym dochodzi do zmian nieżytowych mogących wywoływać zapalenie wyrostka robaczkowego;
2) najczęstszymi objawami są świąd w okolicy odbytu, ból brzucha i nadmierna pobudliwość ruchowa;
3) w leczeniu farmakologicznym stosuje się pyrantel w dawce 10 mg/kg m.c. w dawce jednorazowej, nie przekraczając dawki maksymalnej 2 g;
4) do zakażenia dochodzi drogą pokarmową przez połknięcie jaj unoszących się w kurzu domowym;
5) może dochodzić do autoendoinwazji zwłaszcza u osób z zaparciami. Prawidłowa odpowiedź to:

Wskaż prawdziwe stwierdzenia dotyczące antybiotykoterapii w gabinecie lekarza rodzinnego:
1) u osób dorosłych z pozaszpitalnym zapaleniem płuc o łagodnym przebiegu, lekiem pierwszego rzutu jest cefuroksym;
2) u 2-miesięcznego dziecka z podejrzeniem zapalenia płuc możliwym czynnikiem etiologicznym jest Chlamydia trachomatis;
3) jednym z niekorzystnych czynników rokowniczych w leczeniu pozaszpitalnym w skali CRUB65 jest liczba oddechów powyżej 30;
4) u osób starszych pozaszpitalne zapalenie płuc może przebiegać bez gorączki, ale z zaburzeniami świadomości;
5) w przypadku zakażenia patogenami atypowymi może pojawić się świszczący oddech. Prawidłowa odpowiedź to:

Wskaż prawdziwe stwierdzenia dotyczące gruźlicy w Polsce:
1) w przypadku chorych na gruźlicę, przewlekle prątkujących, leczenie prowadzi się zgodnie z antybiogramem;
2) w przypadku gruźlicy noworozpoznanej schemat terapeutyczny zaczyna się od dwóch leków;
3) leczenie gruźlicy prosówkowej trwa minimum 18 miesięcy;
4) gruźlica pierwotna zazwyczaj dotyczy dzieci;
5) objawy to najczęściej gorączka, nocne poty, najpierw suchy kaszel, a następnie produktywny. Prawidłowa odpowiedź to:

Wskaż prawdziwe stwierdzenia dotyczące witaminy D3:
1) pokarmy bogate w witaminę D3 to np. węgorz świeży, sardynki, żółtko jajka kurzego, ser;
2) suplementację witaminą wprowadza się od pierwszych dni życia, u noworodka donoszonego, w dawce 400 j.m./24 h;
3) jej niedobór jest czynnikiem ryzyka rozwoju m.in. depresji, choroby Alzheimera, stwardnienia rozsianego;
4) dieta wegetariańska jest jednym z czynników ryzyka jej niedoboru;
5) suplementacja witaminy obniża ryzyko zachorowania na cukrzycę typu I. Prawidłowa odpowiedź to:

Wskaż prawdziwe stwierdzenia dotyczące nadciśnienia tętniczego:
1) nadciśnienie tętnicze II stopnia jest rozpoznawane przy ciśnieniu skurczowym o wartości 160- 179 mmHg;
2) przeciwwskazaniem do stosowania diuretyków tiazydowych jest dna moczanowa;
3) lekami hipotensyjnymi preferowanymi u pacjenta z rozpoznaną cukrzycą i białkomoczem są inhibitory konwertazy angiotensyny lub antagoniści receptora angiotensyny;
4) chorzy na astmę nie powinni być leczeni beta-adrenolitykami niekardioselektywnymi;
5) u osób powyżej 80. roku życia z wyjściowym ciśnieniem tętniczym skurczowym >160 mmHg, lekarz rodzinny będzie dążył do obniżenia ciśnienia tętniczego skurczowego do 140-150 mmHg. Prawidłowa odpowiedź to:

Wskaż prawdziwe stwierdzenia dotyczące zawału serca:
1) ból uciskający za mostkiem, mogący promieniować do prawej ręki lub żuchwy jest typowy dla zawału serca;
2) u osób po 75. roku życia zawał serca może manifestować się jako ból w nadbrzuszu bez uchwytnej przyczyny;
3) troponiny nie umożliwiają różnicowania między NSTEMI i niestabilną dławicą piersiową;
4) lekarz rodzinny po wykonaniu EKG i stwierdzeniu zawału serca powinien podać pacjentowi kwas acetylosalicylowy w dawce 125-325 mg przed przyjazdem pogotowia ratunkowego;
5) osłuchowo, ostrej niewydolności lewej komory serca mogą towarzyszyć rzężenia. Prawidłowa odpowiedź to:

Wskaż prawdziwe stwierdzenia dotyczące pokrzywki:
1) do metod diagnostycznych zalicza się próby wysiłkowe, wibracyjne, świetlne;
2) w przypadku przewlekłej pokrzywki spontanicznej należy oznaczyć stężenie hormonów tarczycy;
3) w zaostrzeniach można stosować krótkotrwałą glikokortykoterapię systemową (CRUSH Therapy);
4) u kobiet w ciąży nie stosuje się glikokortykosteroidów systemowych;
5) w przypadku utrzymujących się zmian można zastosować leczenie biologiczne. Prawidłowa odpowiedź to:

Wskaż prawdziwe stwierdzenia dotyczące gorączki u dziecka w gabinecie POZ:
1) gorączka oporna na leczenie lekami przeciwgorączkowymi oraz antybiotykami jest typowa dla Choroby Kawasakiego;
2) u noworodków dopuszczalne jest przeprowadzenie pomiaru temperatury umieszczając termometr elektroniczny pod pachą;
3) termometry skroniowe nie powinny być wykorzystywane przy podejmowaniu decyzji klinicznych;
4) ochładzanie dziecka z wysoką gorączką nie jest zalecane, ponieważ jest mało skuteczne;
5) u dziecka z gorączką i wysypką nieblednąca pod wpływem ucisku, np. w teście szklanki, powinno nasunąć się podejrzenie posocznicy meningokokowej. Prawidłowa odpowiedź to:

Wskaż czynniki rozwoju raka przełyku:
1) palenie papierosów i alkohol;
2) rak głowy i szyi w wywiadzie;
3) oparzenia przełyku;
4) zespół Plummera-Vinsona;
5) zespół Zollingera-Ellisona. Prawidłowa odpowiedź to:

