Wskaż prawdziwe stwierdzenia dotyczące współczynnika umieralności okołoporodowej:
1) jest to liczba martwych urodzeń wraz ze zgonami w 1. tygodniu życia w odniesieniu do liczby żywych i martwych urodzeń;
2) odnosi się do liczby dzieci zmarłych w ciągu 2 pierwszych tygodni życia w stosunku do liczby żywych urodzeń w tym okresie;
3) jest on wykorzystywany do oceny opieki zdrowotnej nad matką i dzieckiem;
4) współczynnik umieralności okołoporodowej w 1985 roku w Polsce wynosił 21,8 (na 1000);
5) współczynnik umieralności okołoporodowej w 2006 roku w Polsce wynosił 6,0 (na 1000). Prawidłowa odpowiedź to:

Wskaż prawdziwe stwierdzenia dotyczące wskaźnika „utraconej długości życia korygowanej niepełnosprawnością” (DALY):
1) wskaźnik ten stanowi próbę całościowego ujęcia problemu chorób i ich wpływu na życie ludzi przez połączenie w jednym wskaźniku długości życia i obniżenia się jakości życia związanego z niepełnosprawnością i inwalidztwem;
2) metodologia obliczania DALY jest skomplikowana, wymaga wielu dobrej jakości, pełnych danych o sytuacji zdrowotnej;
3) gdy mierzone jest obciążenie chorobą dla społeczeństwa, DALY jest kombinacją 2 pomiarów: strat potencjalnych lat życia z powodu przedwczesnych zgonów oraz strat w zdrowiu z powodu niepełnosprawności;
4) do obliczenia utraty DALY spowodowanej przedwczesną umieralnością stosuje się tzw. standardowe oczekiwane lata życia;
5) utratę DALY spowodowaną niepełnosprawnością oblicza się mnożąc długość życia chorych przez współczynnik odpowiadający wadze ich niepełnosprawności. Prawidłowa odpowiedź to:

